import { Flex, Box } from "@radix-ui/themes";
export default function About() {
  return (
    <Flex>
      <Box>
        <h1>About Me</h1>
      </Box>
      <Box>
        <p>Here is some info about me</p>
      </Box>
    </Flex>
  );
}
